handleSelectChange = async (select) => {
  const radVals = [...radiantSelects].map(x => x.value);
  const direVals = [...direSelects].map(x => x.value);

  let data = [];

  for (let i = 0; i < 236; ++i) {
    data.push(0);
  }

  for (const val of radVals) {
    data[val - 1] = 1;
  }

  for (const val of direVals) {
    data[val - 1 + 118] = 1;
  }

  const url = 'https://radiant-wave-10162.herokuapp.com/';
  const payload = { "data": data };

  try {
    const response = await fetch(url, {
      method: 'POST', // or 'PUT'
      body: JSON.stringify(data), // data can be `string` or {object}!
      headers: {
        'Content-Type': 'application/json'
      }
    });
    const res = await response.text();

    if (res == "False") {
      document.getElementById("rad-win-alert").style.display = "none";
      document.getElementById("dire-win-alert").style.display = "block";
    } else {
      document.getElementById("rad-win-alert").style.display = "block";
      document.getElementById("dire-win-alert").style.display = "none";
    }
  } catch (error) {
    console.error('Error:', error);
  }}
